  [],\n\t\"revision_timestamp\": \"2016-01-29T13:51:54.281464\",\n\t\"name\": \"nist-simulation-of-electron-spectra-for-surface-analysis-sessa-srd-100\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"SESSA has been designed to facilitate quantitative
  analyses by Auger electron spectroscopy (AES) and X-ray photoelectron spectroscopy
  (XPS). The database contains physical data required for quantitative interpretation
  of an electron spectrum for a specimen with a given composition. Retrieval of relevant
  data is performed by a small expert system [1-3] that queries the comprehensive
  databases. A simulation module is also available within SESSA that provides an estimate
  of peak intensities as well as the energy and angular distribution of the emitted
  electron flux. The information needed by the expert system to accomplish its task
  closely matches instrument settings made by an experimenter when actually performing
  a measurement and is complemented by an initial estimate of the sample composition.\",\n\t\"license_title\":
